import React, { Component } from "react";

class FavBooks extends Component {
    render() {
        return (
            <div>
                <h2>FAVORITE BOOKS</h2>
                <p>Books are great and everyone should have a list of favorite reads.</p>
                <p>Mine are:</p>
                <ol>
                    <li>Court of Thorns and Roses</li>
                    <li>Ready Plaer One</li>
                    <li>The Dune Series</li>
                    <li>The Lords of the Rings Trilogy</li>
                    <li>the Junlge Book</li>
                </ol>
            </div>
        );
    }
}

export default FavBooks;
